import React from "react";

export const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    appendDots: dots => (
        <div
          style={{
            color: "#fff",
            borderRadius: "10px",
            padding: "10px"
          }}
        >{dots}
        </div>
      ),
};
